script: |
  super -f text -I q12841.spq | sort > q12841.out

inputs:
  - name: q12841.spq
    data: |
      SELECT DISTINCT - col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 + - 91 - + 14 * + 56 IN ( col0, 38, - - col1 );
  - name: tab1

outputs:
  - name: q12841.out
    data: |
      -59
      -68
      -96
